        <Img src={logo} />
      </header>

      <body className="App-body">
        <div className="">
          <input className="box-question" type="text" placeholder="Type here..."/>
          <button className="button-submit" type="submit">Find</button>
        </div>
        <div className="">
          <textArea className="box-context"/>
        </div>
      </body>

      <footer className="App-footer">

      </footer>
    </div>
  );
}
export default App;
